pub fn _mm256_maskz_unpackhi_epi64(k: __mmask8, a: __m256i, b: __m256i) -> __m256i {
    unsafe {
        let unpackhi = _mm256_unpackhi_epi64(a, b).as_i64x4();
        transmute(simd_select_bitmask(k, unpackhi, i64x4::ZERO))
    }
}

